import React, { useState } from 'react';

const Bloglist = (user) => {
  const [blogs, setBlogs] = useState([]);
  
  return (
    <div>
      <h1>Blogs</h1>
      <p>{`${user.username} logged in`}</p>
    </div>
  );
}

export default Bloglist;
